import React from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { withRouter } from 'react-router-dom';

import pageConfig from '../../utils/pageConfig';
import PageHeader from '../../components/PageHeader/PageHeader';
import { getActionsFormate } from '../../utils/common';
import { STORE } from '../../utils/constants';

class ListPage extends React.Component {
  componentDidMount() {
    const { makeCall, page } = this.props;
    const type = pageConfig[page].actions.fetchList;
    makeCall(type);
  }

  render() {
    const { page } = this.props;
    const { pageTitle, headerActions } = pageConfig[page];
    return (
      <div className="list-page">
        <PageHeader title={pageTitle} actions={headerActions} />
        <div>Hello world</div>
      </div>
    );
  }
}

ListPage.propTypes = {
  page: PropTypes.string.isRequired,
  makeCall: PropTypes.func.isRequired,
  dataCard: PropTypes.oneOfType([
    PropTypes.array,
    PropTypes.object
  ]).isRequired,
};

ListPage.defaultProps = {};

const mapStateToProps = state => 
  {
    const {page} = this.props;
    return{
    dataCard: ()=> state.listReducerStore[pageConfig[this.props.page].store.storedList]
    }
  }

const mapDispatchToProps = dispatch => {
  return {
    makeCall: (type, data) => {
      dispatch(getActionsFormate(type, data));
    }
  };
};

export default withRouter(
  connect(
    mapStateToProps,
    mapDispatchToProps
  )(ListPage)
);
